using TaleSpire.Slab.V2;

namespace TaleSpire.Slab.Tests
{
    /// <summary>
    /// Tests for slabs.
    /// </summary>
    public class SlabTests
    {
        [Theory]
        [MemberData(nameof(Slabs))]
        public void When_ParseSlabs_Expect_AssetCount(string slabString, int assets)
        {
            var slab = Slab.Import(slabString);

            // count the number of assets
            var layoutSlab = Assert.IsAssignableFrom<ILayoutSlab>(slab);
            int count = 0;
            foreach (var layout in layoutSlab.Layouts)
                count += layout.AssetCount;
            Assert.Equal(assets, count);
        }

        [Theory]
        [MemberData(nameof(Slabs))]
        public void When_ParseSlabsAndExport_Expect_Original(string slabString, int _)
        {
            var slab = Slab.Import(slabString);
            string ownExport = slab.Export();

            var expected = ToBytes(slabString);
            var actual = ToBytes(ownExport);

            Assert.Equal(expected, actual);
        }

        private static byte[] ToBytes(string slabString)
        {
            byte[] decoded = Convert.FromBase64String(slabString);
            using var inputStream = new MemoryStream(decoded);
            using var gzip = new GZipStream(inputStream, CompressionMode.Decompress);
            using var r = new BinaryReader(gzip);
            return r.ReadBytes(64000);
        }

